import './App.css';

import Header from './components/ui/Header';
import bg from './img/bg.jpg';

function App() {
  return (
    <div className=" text-red-500 container mx-auto py-0 px-20">
      <img src= {bg} alt=""/>
      <Header/>
    </div>
  );
}

export default App;
